import React from 'react';
import './App.css';
import Layout from './components/Layout/Layout';
import {BrowserRouter} from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <BrowserRouter>
      <Layout/>
      <Route exact={true} path='/dashboard' render={() => (
            <div className="App">
              Hi
            </div>
         )}/>
    </BrowserRouter>
    </div>
  );
}

export default App;
